question:
Consider the following code segment.
 int num1 = value1, num2 = value2, num3 = value3;
 while (num1 > num2 || num1 > num3)
 {
 /* body of loop */
 }
 You may assume that value1, value2, and value3 are int values. Which of the following is sufficient to guarantee that /* body of loop */will never be executed?

question_with_variants:
Consider the following code segment.
 int num1 = value1, num2 = value2, num3 = value3;
 while (num1 > num2 || num1 > num3)
 {
 /* body of loop */
 }
 You may assume that value1, value2, and value3 are int values. Which of the following is sufficient to guarantee that /* body of loop */will never be executed?

1) num1 < num3
2) num1 == num3 && num1 > num2
3) num1 > num2 || num1 < num3
4) num1 < num2 && num1 < num3
5) num1 == num2 && num1 > num3
6) num1 < num2 || num1 < num3
7) num1 == num2 || num1 == num3
8) num1 < num2
9) num1 > num2 && num1 > num3

